const initialState = {
    name : 'wi',
    age : 28,
    passwrord: 'babo',
};

const changeNickName = {
    type: 'CHANGE_NICKNAME',
    data: 'boogicho'
}

const rootReducer = (state= initialState, action) => {
    switch(action.type) {
        case 'CHANGE_NICKNAME':
            return {
                ...state,
                name : action.data
            }
    }
}

export default rootReducer
